import {useEffect, useState} from 'react'
import axios from 'axios'




export default function Main(){


	useEffect(()=>{
	axios({
		url:'http://localhost:8000/products/',
		method:'GET',
	}).then(res => {
		if(res.status===200){
		console.log(res.data)
		}
	}).catch(err => console.log(err))

	}, [])
	return (

		<div>
		Main page	
		</div>
	)

}
